/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {
  const stringMapOfS = new Map();
  const stringMapOfT = new Map();

  for (const char of s) {
    if (stringMapOfS.has(char)) {
      stringMapOfS.set(char, stringMapOfS.get(char) + 1);
    } else {
      stringMapOfS.set(char, 1);
    }
  }

  for (const char of t) {
    if (stringMapOfT.has(char)) {
      stringMapOfT.set(char, stringMapOfT.get(char) + 1);
    } else {
      stringMapOfT.set(char, 1);
    }
  }

  for (const char of t) {
    // checking if the char is not in the hashmap and return it
    if (!stringMapOfS.has(char)) {
      return char;
      // checking if the character is present but the occuence of that char in the target string is more then return that char
    } else if (stringMapOfS.get(char) < stringMapOfT.get(char)) {
      return char;
    }
  }
};

console.log(findTheDifference("abcd", "abcde"));
console.log(findTheDifference("a", "aa"));

